import React from 'react';

class Displayin4 extends React.Component {
    render() {
        const { lannisters, starks, name, age, death } = this.props;

        return (
            <div>
                {name && (
                    <div>
                        <div>My name is {name}, I am {age}, I died from {death}.</div>
                    </div>
                )}

                {lannisters && lannisters.map((character) => (
                    <div key={character.id}>
                        <div>My name is {character.name}, I am {character.age}, I live in {character.address}.</div>
                    </div>
                ))}

                {starks && starks.map((character) => (
                    <div key={character.id}>
                        <div>My name is {character.name}, I am {character.age}, I live in {character.address}.</div>
                    </div>
                ))}
            </div>
        );
    }
}

export default Displayin4;
